import React from "react";

import {
    CssClasses,
    addColorTypeToCssClass,
    bootstrapTitles
} 
from "../../utilities";

export const H1 = props => {
    const classes = new CssClasses();

    addColorTypeToCssClass({
        type: "text",
        classes: classes,
        props: props
    });
    
    console.log(classes.toString());

    const newProps = {...props};
    newProps["className"] = classes.toString();

    console.log(newProps);

    return bootstrapTitles.h1(props);
}
